import { Link, NavLink } from "react-router-dom";
import { MobileWrapper } from "../Styles/Modal-Style";


function MobileNavigation({showMobileNav, setshowMobileNav}) {
    return(
        <>
            <MobileWrapper className={showMobileNav ? 'active' : ''}>
                <div className="mobile_inner">
                    <div className="top_section">
                        <div className="img">
                            <img src="/images/profile_img.jpeg" alt="" />
                        </div>
                        <h3>Joydeep Barik</h3>
                    </div>
                    <div className="bottom_section">
                        <li><NavLink to="/home" className="nav_item">Home</NavLink></li>
                        <li><NavLink to="/about-us" className="nav_item">About Us</NavLink></li>
                        <li><NavLink to="/contact-us" className="nav_item">Contact Us</NavLink></li>
                        <li><NavLink to="/blog" className="nav_item">Blogs</NavLink></li>
                    </div>
                </div>
            </MobileWrapper>
        </>
    );
}

export default MobileNavigation;
